import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import KYCStep1 from "./pages/KYCStep1";
import KYCStep2 from "./pages/KYCStep2";
import KYCStep3 from "./pages/KYCStep3";
import KYCStep4 from "./pages/KYCStep4";
import KYCStep5 from "./pages/KYCStep5";

export default function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50 flex flex-col">
        <header className="bg-blue-800 text-white py-4 shadow-md text-center text-xl font-semibold">
          HDFC Bank â€“ Digital KYC
        </header>

        <main className="flex-1 flex justify-center items-center">
          <Routes>
            <Route path="/" element={<KYCStep1 />} />
            <Route path="/kyc-step2" element={<KYCStep2 />} />
            <Route path="/kyc-step3" element={<KYCStep3 />} />
            <Route path="/kyc-step4" element={<KYCStep4 />} />
            <Route path="/kyc-step5" element={<KYCStep5 />} />
          </Routes>
        </main>

        <footer className="bg-gray-200 text-gray-700 py-2 text-center">
          &copy; {new Date().getFullYear()} HDFC Bank
        </footer>
      </div>
    </Router>
  );
}
